import React from 'react'
import { Link } from "react-router-dom";
import './home.css'
function Home2() {
  return (
    <div>
    <h1>Welcome to Airlines!</h1>
        <nav class="topnav">
        <ul> 
        <Link to="/signup"><li><button type="submit" class='button'>LOGIN</button></li></Link>
          <Link to="/Home"><li><h3>UPDATE</h3></li></Link>
          <Link to="/Home"><li><h3>DELETE</h3></li></Link>
        <Link to="/Home"><li><h3>READ</h3></li></Link>
        <Link to="/Home"><li><h3>CREATE</h3></li></Link>
      </ul>
    </nav>

        </div>
    )
}

export default Home2;
